{"reasoning":"Ground truth describes an NPC whose animation is stuck in a T-pose/A-pose: the model keeps the default pose, legs do not animate, and the character slides continuously (e.g., up stairs) while slightly floating. The key traits are: T-pose, no leg animation, continuous sliding movement.

Generated report instead describes an NPC that teleports to different positions between frames during a dialogue scene. There is no mention of the character being locked in a T-pose or sliding; the defect is discrete position jumps rather than continuous sliding with static pose. Although it mentions occasional hovering, that alone is insufficient—the defining T-pose/sliding behavior is absent and the teleporting behavior is not in the ground truth.

Because the symptoms and animation problems differ significantly, the two reports refer to different underlying bugs.","match":false}

{"reasoning":"Ground-truth: when boarding another ship the character lands on the ship’s side, gets ‘frozen’ in mid-air (still playing falling animation) and only after some time drops into the water. Key points: 1) character is suspended beside the ship, not on the deck, 2) animation is falling-loop, 3) temporary levitation before falling.

Generated report: character lands on the deck, collision with deck plane fails immediately, so the avatar clips straight through the solid geometry and falls into the water, triggering desync. There is no mention of being stuck floating beside the ship, nor of a prolonged fall animation; the problem is specifically “falling through the deck” rather than “hanging in mid-air along the ship’s side”.

Although both issues involve ship-related collision problems that end with the player in the water, the symptoms and locations are different and point to different collision errors. Therefore they are unlikely to be the same underlying bug.","match":false}

{"reasoning":"Ground truth bug is about two NPCs sharing the exact same coordinates, appearing as a single entity until the player attacks, after which they separate. Key aspects: NPC overlap, splitting after attack.

Generated report focuses on a visual white outline around characters, NPCs clipping through vegetation, and an unexpected counter decrease. It never mentions NPCs occupying the same spot or splitting when attacked. The visual artifact and clipping are different symptoms and likely arise from different rendering/collision problems than the overlapping-and-splitting NPC bug.

Therefore, the two descriptions do not refer to the same underlying issue.","match":false}

{"reasoning":"Ground truth: police officer visible, the person he handles and the police car are invisible. Net visual result: officer looks like he is putting someone into a car that isn’t rendered, so to the viewer he seems to be sitting/working in thin air.

Generated report: describes the officer “sitting in mid-air without any supporting surface,” maintaining a seated pose over several frames. It does not explicitly mention the missing car or person, but the visual symptom it highlights (officer hovering in seated position) is exactly what a viewer would observe when the car model is invisible. Both reports therefore point to the same underlying rendering issue where surrounding objects (car, person) are not drawn, leaving only the officer visible and apparently floating. Differences in wording (calling it a physics glitch, mentioning a bus-stop) do not contradict the essential symptom.

Hence they describe the same bug.","match":true}

{"reasoning":"The ground-truth bug is that a tackled player is propelled upward ("thrown into the air") after contact. The essence is an excessive upward force/launch.

The generated report discusses a different symptom: after a collision the player simply falls with stiff animation and then stays stuck on the ground, lacking proper blending or recovery. There is no mention of the player being launched upward or airborne; instead the problem is poor fall animation and being stuck.

Because the core behavior (player launched into air vs. player falls and remains static) differs, the two reports refer to different issues.","match":false}

{"reasoning":"Ground-truth bug: after being underwater the character shoots upward, ends up JUST above the water surface, becomes completely frozen in a single animation pose and remains stuck there.

Generated report: the character sometimes hovers above ground and water, can still move (walks on water), animations continue (jerky, limbs move), and the player is not said to be stuck. There is no mention of the specific trigger of coming from underwater or of getting locked in one pose. Instead it describes general hovering and collision issues and even disappearance/re-appearance.

Because the key symptom of "rises from underwater and becomes frozen in place" is absent, and the generated report instead describes a different, movable hover/walk-on-water issue, the two reports point to different underlying bugs.","match":false}

{"reasoning":"Ground truth: NPC/droid gets stuck hanging sideways off the edge of a platform, suspended in mid-air for a moment, then slowly falls off. Key elements: edge of platform, mid-air suspension, sideways orientation, eventual fall.

Generated report: Droid is partly embedded (clipping) in the solid floor, visible from above; no mention of being on an edge, suspended, sideways, or eventually falling—just intersection with the floor plane.

While both mention a droid and collision problems, the specific symptom/location (edge mid-air vs. floor embedding) and behavior (hang then drop vs. constant clipping) differ. These are likely different collision bugs.","match":false}

{"reasoning":"Ground truth bug involves a physics glitch where, after the NPC is shot, the body first falls and is then violently propelled upward and sideways. Core symptoms: requires shooting, sequence of fall then launch.

Generated report describes a visual/physics issue where a chair disappears and the NPC keeps the sitting pose, floating in place. No mention of being shot, no sudden launch motion; issue revolves around object disappearance/rendering and AI crime detection.

Because the triggers, animation outcome, and observed behavior differ significantly, they are not the same underlying bug.","match":false}

{"reasoning":"Ground truth focuses on a single problem: an NPC that lies on a car roof becomes badly deformed, and the deformation increases as the car moves. No other objects are involved.

Generated report describes a different scene: several metal poles/rods are clipping through a car and move with it, and there is only a brief note that a character model is "partially merged" with the vehicle. It does not mention mesh deformation of the character, nor that the distortion grows with movement; instead it emphasizes environmental objects erroneously attached to the car. This is a distinct issue (improper collision attachment/clipping of objects) rather than the progressive character-mesh distortion described in the ground truth.

Because the main symptom and likely root cause differ, the two reports are not referring to the same bug.","match":false}

{"reasoning":"Ground truth: after a jump the car appears to hit an invisible horizontal collider in mid-air and "lands" on it, so it stays suspended above the real ground. Core symptom = car is supported by an invisible surface and does not descend to the track.

Generated report: describes the car keeping a stable orientation, floating/hovering and travelling an unnaturally long distance through the air, then eventually landing far away outside the track. It frames the problem as reduced gravity / extended ballistic arc, not as the car coming to rest on an invisible platform. The vehicle still descends and lands, just farther away; no mention of being held up at a fixed height by an invisible surface.

Because the essential symptom (landing on an invisible platform vs. prolonged unrealistic flight) differs, these are likely two separate bugs.","match":false}

{"reasoning":"Ground truth bug: a single event where a large sea creature briefly slides, then completely disappears. Key characteristics: (1) involves a giant sea creature, (2) motion-snap/slide for a fraction of a second, (3) afterwards the creature is gone.

Generated report: focuses mainly on visual distortion of a blue holographic scanner beam. It also mentions that a “tentacled creature with yellow light patterns” has “parts of it appearing and disappearing between frames,” i.e., flickering, but does not mention the creature performing a sudden slide motion or totally vanishing after the slide. The core issue described is general rendering glitches affecting multiple objects (UI beam, environment colours, creature), not the specific slide-then-disappear behavior of a single sea creature.

Because the generated report does not capture the distinctive ‘slide for a fraction of a second and then disappear’ symptom, and instead describes broader, different visual problems, the two descriptions do not refer to the same underlying bug.","match":false}

{"reasoning":"Ground truth bug: after some action the character hangs motionless in the air for a few seconds, then gravity resumes and the character falls. The key behaviour is a brief mid-air freeze independent of climbing, animation distortion, or terrain clipping.

Generated report: concerns a climbing scenario where the character’s animation becomes distorted (rotates sideways/upside-down, clips through terrain, mis-aligns). One symptom mentioned is that the character "appears to be suspended in mid-air while still in a climbing pose", but this is part of a broader climbing-animation glitch and there is no mention that the suspension lasts only a couple of seconds or that the character subsequently falls normally. The primary issue described is animation/attachment problems on climbing surfaces, not a short physics freeze followed by a fall.

Because the circumstances (during climbing vs any general movement), additional symptoms (animation distortion, clipping) and likely root cause differ, these descriptions point to different bugs.","match":false}
